(2, 0, '<h2 id=\"Настройкалокальнойверсиисайта\" style=\"margin: 40px 0px 20px; padding: 20px 0px 0px; border-width: 1px 0px 0px; border-top-style: solid; border-right-style: initial; border-bottom-style: initial; border-left-style: initial; border-top-color: rgb(221, 221, 221); border-right-color: initial; border-bottom-color: initial; border-left-color: initial; border-image: initial; outline: 0px; font-weight: inherit; font-style: inherit; box-sizing: border-box; line-height: 1em;\">Настройка локальной версии сайта</h2><ol style=\"margin-top: 10px; margin-bottom: 15px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; box-sizing: border-box; counter-reset: step-counter 0;\" class=\" list-paddingleft-2\"><li><p><a style=\"margin-top: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; box-sizing: border-box; color: rgb(20, 115, 230); margin-right: 0px !important;\" name=\"step_par_text_0\"></a></p><p style=\"margin-top: 0px; margin-bottom: 10px; margin-left: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; box-sizing: border-box; overflow-wrap: break-word; margin-right: 0px !important;\">В программе Dreamweaver выберите «Веб-сайт» &gt; «Создать веб-сайт».</p></li></ol><ul class=\" list-paddingleft-2\"><li><p><a style=\"margin-top: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; box-sizing: border-box; color: rgb(20, 115, 230); margin-right: 0px !important;\" name=\"step_par_text_0\"></a></p><p style=\"margin-top: 0px; margin-bottom: 10px; margin-left: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; box-sizing: border-box; overflow-wrap: break-word; margin-right: 0px !important;\">В диалоговом окне «Настройка сайта» убедитесь, что выбрана категория сайта.</p></li></ul><ul class=\" list-paddingleft-2\"><li><p><a style=\"margin-top: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; box-sizing: border-box; color: rgb(20, 115, 230); margin-right: 0px !important;\" name=\"step_par_text_0\"></a></p><p style=\"margin-top: 0px; margin-bottom: 10px; margin-left: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; box-sizing: border-box; overflow-wrap: break-word; margin-right: 0px !important;\">В поле «Имя сайта» введите имя. Имя отображается на панели «Файлы» и в диалоговом окне «Управление веб-сайтами» и не отображается в браузере.</p></li></ul><ul class=\" list-paddingleft-2\"><li><p><a style=\"margin-top: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; box-sizing: border-box; color: rgb(20, 115, 230); margin-right: 0px !important;\" name=\"step_par_text_0\"></a></p><p style=\"margin-top: 0px; margin-bottom: 10px; margin-left: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; box-sizing: border-box; overflow-wrap: break-word; margin-right: 0px !important;\">В текстовом поле «Локальная папка сайта» укажите определенную вами ранее папку&nbsp;— папку на компьютере, в которой хранится локальная версия файлов сайта. Щелкните значок папки справа от текстового поля, чтобы открыть папку для обзора.</p><p><img src=\"https://unibyte.pro/res/2019/06-19/20/005993a20cc39e17459b4f72d5cf26e6.png\" alt=\"Настройка локальной папки сайта\" title=\"Настройка локальной папки сайта\" style=\"margin-top: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; box-sizing: border-box; overflow-x: auto; height: auto; margin-right: 0px !important;\"/></p><p>Настройка локальной папки сайта</p><p><small style=\"margin-top: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; box-sizing: border-box; margin-right: 0px !important;\"><br style=\"box-sizing: border-box; margin: 0px; line-height: 1em; padding: 0px; border: 0px; overflow: hidden;\"/></small></p></li></ul><ul class=\" list-paddingleft-2\"><li><p><a style=\"margin-top: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; box-sizing: border-box; color: rgb(20, 115, 230); margin-right: 0px !important;\" name=\"step_par_text\"></a></p><p style=\"margin-top: 0px; margin-bottom: 10px; margin-left: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; box-sizing: border-box; overflow-wrap: break-word; margin-right: 0px !important;\">Если необходимо использовать Git для управления файлами для вашего сайта, установите флажок «Объединить репозиторий с этим сайтом».&nbsp;</p></li><ul style=\"list-style-type: square;\" class=\" list-paddingleft-2\"><li><p>Если вы работаете с Git впервые и хотите связать создаваемый сайт с Git, выберите функцию «Инициализация с репозиторием Git».</p></li><li><p>Если у вас уже есть учетная запись в Git и вам необходимо связать создаваемый сайт с уже существующим репозиторием, выберите функцию «Клонировать существующий репозиторий Git, используя URL-адрес».</p></li></ul></ul><ul class=\" list-paddingleft-2\"><li><p><a style=\"margin-top: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; box-sizing: border-box; color: rgb(20, 115, 230); margin-right: 0px !important;\" name=\"step_par_text_0\"></a></p><p style=\"margin-top: 0px; margin-bottom: 10px; margin-left: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; box-sizing: border-box; overflow-wrap: break-word; margin-right: 0px !important;\">Нажмите «Сохранить», чтобы закрыть диалоговое окно «Настройка сайта». Теперь можно начать работу с локальными файлами сайта в Dreamweaver.</p></li></ul><p><a style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; box-sizing: border-box; color: rgb(20, 115, 230);\" name=\"main-pars_text_1\"></a></p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; box-sizing: border-box; overflow-wrap: break-word;\">Эта папка является тем местом на вашем локальном компьютере, где хранятся рабочие копии веб-страниц.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; box-sizing: border-box; overflow-wrap: break-word;\">Если позднее вы захотите опубликовать страницы, сделав их общедоступными, то вам придется определить удаленную папку (или сервер публикации)&nbsp;— место на удаленном компьютере, поддерживающее работу веб-сервера, на котором расположены опубликованные копии ваших локальных файлов.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; box-sizing: border-box; overflow-wrap: break-word;\">Дополнительные сведения об определении удаленного сервера и подключении к нему (или к серверу публикации) см. в разделе&nbsp;<a href=\"https://helpx.adobe.com/ru/dreamweaver/using/connect-remote-server.html\" target=\"_blank\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-weight: inherit; font-style: inherit; box-sizing: border-box; color: rgb(20, 115, 230); text-decoration-line: none;\">Подключение к серверу публикации</a>.</p><p><br/></p>'),
